import Card from './Card';

export default function Body(prop) {
    return (
        <>
        <div className="row">


        {console.log(prop.users.users[0].link)}
<div className="col-md-3"> <Card link={prop.users.users[0].link} name={prop.users.users[0].Name}/></div>
<div className="col-md-3"> <Card link="https://scontent.fnag6-1.fna.fbcdn.net/v/t39.30808-1/272747677_396474988914665_8946758240933412954_n.jpg?stp=dst-jpg_s320x320&_nc_cat=110&ccb=1-5&_nc_sid=7206a8&_nc_ohc=7izi0amCegcAX8MDFtP&_nc_oc=AQl0ozNMcpF-SpBNKeyhTnZzvTLvBO4z6JjBJm1tZb3ySDhINlVrPFkGoWD1PBj4hbv1J8Ve7suLp4ij0eal5C44&_nc_ht=scontent.fnag6-1.fna&oh=00_AT-T6XLSzmQJ_Hzzm9bJ21xYgxQgYQ7hnj82i9HoFMC9Fg&oe=625F6037"/></div>
<div className="col-md-3"> <Card link="https://scontent.fnag6-1.fna.fbcdn.net/v/t39.30808-1/275330086_4863760507053333_2417791502430504164_n.jpg?stp=dst-jpg_p320x320&_nc_cat=110&ccb=1-5&_nc_sid=7206a8&_nc_ohc=xXe7gdMgiY0AX-hZO2m&_nc_ht=scontent.fnag6-1.fna&oh=00_AT-KfXpDh65cPDzhWKxbNSbZp7a_5VnlFZI70pPetEh0kw&oe=626027E9"/></div>
<div className="col-md-3"> <Card link="https://scontent.fnag6-1.fna.fbcdn.net/v/t1.6435-1/94538263_662226544321079_7587072162314321920_n.jpg?stp=c0.66.320.320a_dst-jpg_p320x320&_nc_cat=105&ccb=1-5&_nc_sid=7206a8&_nc_ohc=UByclxxJbooAX89FGnU&_nc_ht=scontent.fnag6-1.fna&oh=00_AT-QZ-NhMPlw7-PH_hBhfIZwRm9kJ_JfC8WmEoHFfMdYng&oe=627FE2CF"/></div>
